export const APP_ACTIONS = {
  onEmailChange: "ON_EMAIL_CHANGE",
  onPasswordChange: "ON_PASSWORD_CHANGE",
};

export const onEmailChange = (formType, event) => {
  return {
    type: APP_ACTIONS.onEmailChange,
  };
};
